    //     sendMatchResult(teams[_winnerAddress]);
    // }

    function sendMatchResult(string _winner) public onlyOwner {
        for (uint i = 0; i < teamAddresses.length; i++) {
            Team(teamAddresses[i]).payoutTeam(teams[_winner]);
        }
    }

    function payOutHouse() public onlyOwner {
        Team(winnerAddress).payoutHouse(owner);
    }

    function payOutPlayers() public onlyOwner {
        Team(winnerAddress).payoutPlayers();
    }
}
